import React, { useEffect } from 'react';

function GroceryList(props) {

        useEffect(() => {
        fetch('/api/groceries')
        .then((res) => {
            return res.json();
        })
        .then((data) => {
            console.log(data)
            props.setGroceries(data.item)

        })
    }, []);

    return (
        <div className='groceryContainer'>
           <ul>
            <li>{props.groceries.item}</li>
           </ul>
        </div>
    );
}


export default GroceryList;

